INSERT INTO "steps" ("id","step_num","step_text","date_created","dishfk") VALUES (1,1,'Spread Mayonaise on two slices of white bread','2021-08-25 09:14:12',69),
 (2,2,'Place 3 - 4 strips of bacon on one slice of the mayo bread','2021-08-25 09:14:43',69),
 (3,3,'place 2 slices of tomato on top of the bacon','2021-08-25 09:15:12',69),
 (4,4,'place 1-2 leaves of lettuce on top of the tomatos','2021-08-25 09:15:46',69),
 (5,5,'place top on sandwich and enjoy','2021-08-25 09:16:20',69),
 (6,1,'Mix the packets of drink mix into the water.  Drink right away','2021-08-25 22:39:36',68),
 (7,1,'Peel and Enjoy','2021-08-26 06:17:34',1),
 (8,1,'Add everything in one microwave safe dish.  Mix well','2021-08-26 06:29:33',9),
 (9,2,'Microwave on high for 5 mins.  Stir every min','2021-08-26 06:30:09',9),
 (10,1,'Peal all carrots','2021-08-26 23:47:37',51),
 (11,2,'Cube All Chicken','2021-08-26 23:47:52',51),
 (12,3,'Place all carrots in a blender and pulse until all small uniform size','2021-08-26 23:48:21',51),
 (13,4,'Blend onion into small pieces.','2021-08-26 23:49:23',51),
 (14,5,'Place carrots, onion, chicken, and chicken stock in a large pot.','2021-08-26 23:49:58',51),
 (15,6,'Bring to boil, reduce to simmer and cook for 1-2 hours','2021-08-26 23:50:17',51),
 (16,7,'Serve over rice or by its self','2021-08-26 23:50:57',51),
 (17,1,'Enjoy','2021-08-27 19:46:25',47),
 (18,1,'Peel potatoes and chop into equal sizes','2021-08-27 19:51:05',74),
 (19,2,'Boil potatoes in salt water until fork tender','2021-08-27 19:51:21',74),
 (20,3,'Drain and back to pot','2021-08-27 19:51:32',74),
 (21,4,'add butter, whipping cream, salt and pepper','2021-08-27 19:51:55',74),
 (22,5,'beat with a hand blender until smooth and fluffy','2021-08-27 19:52:10',74),
 (23,6,'Enjoy','2021-08-27 19:52:15',74),
 (24,1,'place peas, butter, salt, and pepper in a medium size pot and cook on medium high heat until warmed through','2021-08-27 19:54:25',43),
 (25,2,'enjoy','2021-08-27 19:54:29',43),
 (26,1,'Combine butter, garlic powder, and Parmesan Cheese in a bowl','2021-08-30 05:37:00',40),
 (27,2,'slice bread in half like a hot dog bun','2021-08-30 05:37:58',40),
 (28,3,'Spread mixture evenly on each half of the bread','2021-08-30 05:38:23',40),
 (29,4,'Bake at 400 degrees for apron 10 mins until golden brown','2021-08-30 05:38:41',40),
 (30,1,'Place ham in Oven Safe dish','2021-08-31 08:25:32',4),
 (31,2,'Mix melted butter and brown sugar in a bowl','2021-08-31 08:26:00',4),
 (32,3,'glaze the ham with the butter/sugar mixture','2021-08-31 08:26:16',4),
 (33,4,'cover with aluminum foil tightly','2021-08-31 08:26:43',4),
 (34,5,'bake for 45 mins to 1 hour at 350 or until warmed through','2021-08-31 08:27:06',4),
 (35,1,'Fry until cooked through','2021-08-31 19:34:46',33),
 (36,1,'Open and Enjoy','2021-09-05 05:37:03',13),
 (37,1,'Heat the oil in a large heavy-bottom pot over medium-high heat. Add the carrot, onion, celery and 1 teaspoon salt and cook, stirring occasionally, until the vegetables are starting to caramelize and take on a dark brown color, 8 to 10 minutes (this step is important as it will add tons of flavor to your soup!).','2021-10-23 03:01:33',78),
 (38,2,'Stir in the tomato paste and garlic and cook, scraping up the brown bits, until the garlic is fragrant and slightly softened, 1 to 2 minutes. Add in the lentils, stock, 4 cups water, thyme, bay leaf, oregano, red pepper flakes, lemon zest, 2 teaspoons salt and a generous amount of black pepper and stir to combine. Bring to a boil then reduce the heat to low. Cover and cook until the lentils are softened with just a bit of bite, 25 to 30 minutes.','2021-10-23 03:01:40',78),
 (39,3,'Remove the bay leaf. Puree 2 1/2 cups of the soup in a blender until smooth then stir back into the pot. Stir in the lemon juice and parsley. Ladle into bowls and garnish with more parsley.','2021-10-23 03:01:46',78);
